import react,{useState} from 'react'
import Instructionpan from './Instructionpan'
import Emojidata from './Emojidata'
import Emgcard from './Emgcard'
import './Body.css'
const Body=()=>{
const [val,setVal]=useState();
return(
    <>
<div id="Body">
{console.log(val)}
<Instructionpan
Iindex={val}
/>
<div id="innerBody">
{Emojidata.map((val,index)=>{
    return(
    <div id="EmgCard" style={{display:"flex",flexDirection:"column",color:"white"}} onClick={setVal(index)}>
    <Emgcard
    Emoji={val}
    Eindex={index}
    />
    </div>
    )
})}
</div>
    </div>
    </>
)
}
export default Body
